import React from "react";

export default function Plants(props) {
  const { plants } = props;
  return (
    <div>
      <h3>Plants</h3>
      {plants.map((plant) => (
        <React.Fragment key={plant.id}>
          <Link to={`/plants/${plant.id}`}>
            <p>{plant.name}</p>
          </Link>
        </React.Fragment>
      ))}
    </div>
  );
}
